import {Outlet} from 'react-router-dom';

import Subnavigation from '../layouts/subnavigation'
import SubnavItem from '../layouts/subnavitem'

import styled from 'styled-components'
import '../styles/theme.css'

function Dashboards(){
  const navigationActive = ({ isActive }) => {
    return {
      color: isActive ? "white" : "black",
      textDecoration: "none",
    };
  };

  return (
    <StyledContainer>
      <Subnavigation title='Dashboards'>
        <SubnavItem style={navigationActive} to='/dashboards/all'>All</SubnavItem>
        <SubnavItem style={navigationActive} to='/dashboards/saved1'>Dash1</SubnavItem>
        <SubnavItem style={navigationActive} to='/dashboards/saved2'>Dash2</SubnavItem>
      </Subnavigation>
      <Outlet/>
    </StyledContainer>
  )
}

const StyledContainer = styled('div')`
  display: grid;
  grid-template-columns: 200px auto;
`;

export default Dashboards;
